import React from 'react';
import './MobFooter.css';
import { withStyles } from '@material-ui/core/styles';
import MuiAccordion from '@material-ui/core/Accordion';
import MuiAccordionDetails from '@material-ui/core/AccordionDetails';
import MuiAccordionSummary from '@material-ui/core/AccordionSummary';
import { FontAwesomeIcon } from '@fortawesome/react-fontawesome';
import { faPlus } from '@fortawesome/free-solid-svg-icons';

const Accordion = withStyles({
    root: {
      border: '1px solid rgba(0, 0, 0, .125)',
      color: 'white',
      backgroundColor: 'rgb(38, 38, 38)',
      boxShadow: 'none',
      '&:not(:last-child)': {
        borderBottom: 0,
      },
      '&:before': {
        display: 'none',
      },
      '&$expanded': {
        margin: 'auto',
      },
    },
    expanded: {},
  })(MuiAccordion);

  const AccordionSummary = withStyles({
    root: {
      color: 'rgb(37, 37, 37)',
      backgroundColor: 'rgb(237, 240, 245)',
      borderBottom: '1px solid rgba(0, 0, 0, .125)',
      marginBottom: -1,
      minHeight: 56,
      '&$expanded': {
        minHeight: 56,
      },
    },
    content: {
      '&$expanded': {
        margin: '12px 0',
      },
    },
    expanded: {},
  })(MuiAccordionSummary);

  const AccordionDetails = withStyles((theme) => ({
    root: {
      backgroundColor: 'white',
      padding: theme.spacing(2),
    },
  }))(MuiAccordionDetails);

function MobFooter(){

    const [expanded, setExpanded] = React.useState('panel1');

    const handleChange = (panel) => (event, newExpanded) => {
      setExpanded(newExpanded ? panel : false);
    };

    return(
        <div className='mf-wrapper'>

            <div className='mf-button-wrapper'>
                <div className='mf-button red'>
                    <button><strong>REQUEST A QUOTE</strong></button>
                </div>
                <div className='mf-button white'>
                    <button><strong>TRADE-IN VALUE</strong></button>
                </div>
            </div>

            <div className='mf-links-wrapper'>

                <Accordion square onChange={handleChange('panel1')} className='mf-accordion-option'>

                    <AccordionSummary>
                        <div className='mf-accordion-summary'>
                            <div>Cars & Minivans</div>
                            <FontAwesomeIcon icon={faPlus}></FontAwesomeIcon>
                        </div>
                    </AccordionSummary>

                    <AccordionDetails>
                        <div className='mf-accordion-details'>Hello</div>
                    </AccordionDetails>

                </Accordion>

                <Accordion square onChange={handleChange('panel2')} className='mf-accordion-option'>

                    <AccordionSummary>
                        <div className='mf-accordion-summary'>
                            <div>Cars & Minivans</div>
                            <FontAwesomeIcon icon={faPlus}></FontAwesomeIcon>
                        </div>
                    </AccordionSummary>

                    <AccordionDetails>
                        <div className='mf-accordion-details'>Hello</div>
                    </AccordionDetails>

                </Accordion>

            </div>
        </div>
    )
}

export default MobFooter;
